    false,nt"url": null,nt"notes": "These data represent the interpretations
    from borehole electric (resistivity) logs from oil and gas wells and lithologic
    logs from nearby water wells. These interpretations were used to build the hydrogeologic
    framework in the Williston structural basin. The resistivity logs were used to identify
    the hydrogeologic units (fig. 3A of SIR 2014-5047) and to quantify the vertical
    detailed lithology (thickness of sand, coal, gravel, silt, and shale) in the oil
    and gas exploration boreholes.",nt"license_title": null,nt"extras": [{ntt"key":
